A static variable is a variable that retains its value between function calls. When a function is called, the static variable is initialized only once, and its value is preserved across subsequent calls to the function. This means that the value of a static variable is not lost when the function returns.

Here's an example:
```c
#include <stdio.h>

void my_function() {
    static int count = 0;
    count++;
    printf("%d\n", count);
}

int main() {
    my_function(); // prints 1
    my_function(); // prints 2
    my_function(); // prints 3
    return 0;
}
```
In this example, the static variable `count` is initialized to 0 when `my_function` is first called. Each subsequent call to `my_function` increments the value of `count`, so the output is 1, 2, and 3.

**Register Variables**

A register variable is a variable that is stored in a CPU register, rather than in memory. This can improve performance by reducing the number of memory accesses. However, the use of register variables is generally discouraged, as it can make the code less portable and more difficult to understand.

